            constructor(attr) {
                this.color = attr.color;
                this.size = attr.size;
                this.x = attr.x;
                this.y = attr.y;
            }
            
            draw() {
                ctx.fillStyle = this.color;
                ctx.fillRect(this.x, this.y,this.size,this.size);
            }
            
        }


          class Coin {
              constructor(elapsed) {
                  this.x = Math.random() * gameWidth;
                  this.y = Math.random() * gameHeight - (gameHeight/10);
                  this.expire=elapsed + 100 * (Math.random() * 10 + 5);
                  this.r=5;
              }

              expired() {
                  if (elapsed>this.expire) {
                      return true;
                  } else {
                      return false;
                  }
              }

              draw() {
                ctx.fillStyle="blue";
                  ctx.beginPath();
                ctx.arc(this.x, this.y, this.r, 0, 2 * Math.PI);
                ctx.fill();
              }
          }
          
        class weapons {
                constructor(pos) {
                    this.x = pos.x+9;
                    this.y = pos.y;
                }

                draw() {
                    ctx.fillStyle = 'black';
                    ctx.fillRect(this.x,this.y,3,3);
                }

            move() {
                this.y-=2;
            }
        }
          
        class players extends Avatar {
            
            move() {
                if (keys.ArrowUp) {
                    if (this.y-playerSpeed>=0) {
                    this.y-=playerSpeed;
                        } else {
                        this.y = 0;
                        }
                }
                if (keys.ArrowLeft) {
                    if (this.x - playerSpeed >= 0) {
                        this.x-=playerSpeed;
                        } else {
                        this.x = 0;
                        }
                }
                if (keys.ArrowRight) {
                    if (this.x + playerSpeed + this.size <= gameWidth) {
                        this.x+=playerSpeed;
                        } else {
                        this.x=gameWidth-this.size;
                        }
                }
                if (keys.ArrowDown) {
                        if (this.y + playerSpeed + this.size <= gameHeight) {
                                this.y+=playerSpeed;
                            } else {
                                this.y = gameHeight-this.size;
                            }
                }
            }

            shoot() {
                if (bullets.length < 10 ) {
                var bullet = new weapons({ x: this.x, y: this.y});
                bullets.push(bullet);
                sounds.shoot.play();
            }
                }

            hittingAttacker() {
                for (var e=0; e< enemies.length; e++) {
                    if (enemies[e].x+enemies[e].size >= this.x && enemies[e].x <= this.x+this.size && enemies[e].y + enemies[e].size >= this.y && enemies[e].y <= this.y+this.size) {
                       return true; 
                    }
                }
                
            }

            hittingCoin() {
                for (var c=0; c < coins.length; c++) {
                    if (coins[c].x+coins[c].r >= this.x && coins[c].x-coins[c].r <= this.x+this.size && coins[c].y + coins[c].r >= this.y && coins[c].y - coins[c].r <= this.y+this.size) {
                       playerScore+=100;
                        coins.splice(c,1);
                        sounds.coin.play();
                    }
                }
                
            }

            
        }

          class Attacker extends Avatar {

              constructor() {
                  var size = Math.round(Math.random()*15+15); 
                  super({
                      y:-10,
                      x:Math.round(Math.random() * (gameWidth - size) ),
                    color:"red",
                      size: size
                  });
              }
              
              move() {
                  this.y+=gamespeed/3;
              }

              hittingBullet() {
                  for (var b=0; b< bullets.length; b++){
                      if (bullets[b].x >= this.x && bullets[b].x <= this.x+this.size && bullets[b].y >= this.y && bullets[b].y < this.y+this.size) {
                          bullets.splice(b,1);

                          return true;
                      }

                          
                  }
              }
          }
          
        var player = new players({
            color: "cyan",
            size: 20,
            x: 200,
            y: 200
        });


          enemies.push(new Attacker() );

        function endgame(i) {
            clearInterval(interval);
            sounds.game_over.play();
            ctx.font= "100px Courier New";
            ctx.fillStyle="red";
            ctx.fillText("GAME OVER", gameWidth/2-ctx.measureText("GAME OVER").width/2, gameHeight/2-100);

        }
          
        var loop = function() {
            elapsed +=1;
            
            ctx.clearRect(0,0,gameWidth,gameHeight);
            ctx.strokeRect(0,0,gameWidth,gameHeight);
            player.move();
            if (player.hittingAttacker() ) {
                endgame(i);
            } else {
            player.draw();
                }
            player.hittingCoin();

            //print the score and the shield strength
            ctx.fillStyle="black";
            ctx.font= "20px Times New Roman";
            ctx.fillText("Score: " + playerScore.toString(), 10,20);
           // ctx.fillText("Shield: " + shield.toString(), gameWidth-100,20);
            var shieldRed = 255-(2.55*shield);
            var shieldBlue = 2.55*shield;
            ctx.fillStyle="rgb(" + shieldRed.toString() +", 0, " + shieldBlue.toString()  + ")";
//            ctx.fillStyle = (shield > 50 ) ? "blue" : (shield > 30) ? "purple" : "red";
            ctx.fillRect(gameWidth-150,5,shield,20);
            
            ctx.strokeRect(gameWidth-150,5,100,20);
            

            //remove coins if they've expired draw them if they're not;
            for (c=0; c<coins.length; c++){
                if( coins[c].expired() ) {
                    coins.splice(c,1);
                } else {
                    coins[c].draw();
                }
            }
            
            for (i=0; i < enemies.length; i++){
                enemies[i].move();
                
                if (enemies[i].y > gameHeight ) {
                    playerScore -= enemies[i].size;
                    shield -=5;
                    sounds.shield.play();
                    if (shield < 0) {
                        endgame();
                    }
                    enemies.splice(i,1);
                    
                     
                } 
                    else if (enemies[i].hittingBullet()) {
                        playerScore += (50 - enemies[i].size);
                        enemies.splice(i,1);
                        sounds.enemy_hit.play();

                    }
                else {
                enemies[i].draw();
                    }
            }
            
            for (i=0; i < bullets.length; i++){
                bullets[i].move();
                    if (bullets[i].y < 0) {
                        bullets.splice(i,1);
                    } else {
                        bullets[i].draw();   
                    }
            }


            
            var createNewEnemy = Math.random() * (10 + enemies.length*5); 
            if (createNewEnemy < gamespeed /10) {
                enemies.push(new Attacker());
            }

            var createCoins = Math.random() * 10;
            if (createCoins < gamespeed/30 && coins.length < 3) {
                coins.push(new Coin(elapsed));
            }


            
            if( elapsed % 2000 === 0) {
                gamespeed+=0.3;
                console.log(gamespeed);
                if (gamespeed > 3.5) {
                    gamespeed = 1.5
                    }
            } 
            
            
        };

          interval = setInterval(loop,10);

    </script>
    
</html>
